onClipEvent(load){
   当前索引 = 0;
   随机偏离值 = 0;
   攻击频率 = 0;
   目标数组 = [];
   for(var each in _root.gameworld)
   {
      if(_root.gameworld[each].是否为敌人 == !_parent._parent.是否为敌人 and _root.gameworld[each].hp>0)
      {
         目标数组.push(each);
      }
   }
}
onClipEvent(enterFrame){
   攻击频率++;
   if(攻击频率 >= 2)
   {
      攻击频率 = 0;
      当前索敌 = _root.gameworld[目标数组[当前索引]];
      if(random(10) > 5)
      {
         最终随机偏离值 = random(随机偏离值);
      }
      else
      {
         最终随机偏离值 = - random(随机偏离值);
      }
      声音 = "";
      霰弹值 = 1;
      子弹散射度 = 0;
      发射效果 = "";
      子弹种类 = "黑铁-落剑";
      子弹威力 = _parent._parent.空手攻击力 * 3.5;
      子弹速度 = 0;
      击中地图效果 = "";
      Z轴攻击范围 = 60;
      击倒率 = 1;
      击中后子弹的效果 = "空手攻击火花";
      if(_parent._parent.是否为敌人 == true)
      {
         子弹敌我属性 = false;
      }
      else
      {
         子弹敌我属性 = true;
      }
      shootX = 当前索敌._x + 最终随机偏离值;
      shootY = 当前索敌._y + 最终随机偏离值;
      shootZ = 当前索敌.Z轴坐标 + 最终随机偏离值;
      if(random(100) < 50)
      {
         _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,shootZ,子弹敌我属性,击倒率,击中后子弹的效果);
      }
      if(当前索引 < 目标数组.length - 1)
      {
         当前索引++;
      }
      else
      {
         当前索引 = 0;
         随机偏离值 += 30;
         if(随机偏离值 >= 120)
         {
            随机偏离值 = 30;
         }
      }
   }
}

